import React from "react";
import Papa from "papaparse";

export default function ImportCSV() {
  const activeUserId =
    sessionStorage.getItem("activeUserId") !== null
      ? sessionStorage.getItem("activeUserId")
      : null;
  const handleFile = (event) => {
    Papa.parse(event.target.files[0], {
      complete: function (result) {
        const data = [];
        console.log(result);
        result.data.map((d) => {
          return data.push({
            name: d[0],
            email: d[1],
            number: d[2],
            avatar: d[3],
            contactId: d[4],
          });
        });
        const dataToStore = data.shift();
        console.log(data);
        console.log("activeUserId", activeUserId);
        const contacts = JSON.parse(localStorage.getItem([activeUserId])) || [];
        contacts.push(data);
        localStorage.setItem([activeUserId], JSON.stringify(contacts));
      },
    });
  };
  return (
    <div className="App">
      <h1>Import</h1>
      <input
        type="file"
        name="file"
        accept=".csv"
        onChange={handleFile}
      ></input>
    </div>
  );
}
